// Layout.js
import React from "react";
import "./Layout.css";

function Layout({ children }) {
  return (
    <div className="layout">
      <header className="header">
        <h1 className="header-text">Cognizant</h1>
      </header>
      <div className="content">{children}</div>
    </div>
  );
}

export default Layout;
